create table players (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	team_id VARCHAR(2),
	role VARCHAR(3),
	goals INT,
	assists INT,
	total_points INT,
	red_cards INT,
	yellow_cards INT,
	matches_played INT,
	matches_started INT,
	time_played INT,
	clean_sheets INT,
	save_percentage INT
);
